import React, {Component} from 'react';
import {Grid, Segment, Divider, GridColumn} from 'semantic-ui-react';
import Nav from './Nav';

class Layout extends Component{
    render(){
        return(
            <div>
                <Grid relaxed columns={2}>
                    <Grid.Column width={4}>
                        <div color='blue'>
                            All through the night
                        </div>
                    </Grid.Column>

                    <Divider vertical>
                        or
                    </Divider>

                    <GridColumn width={8}>
                        <Nav></Nav>
                    </GridColumn>

                </Grid>
            </div>
        );
    }
}

export default Layout;
